import React from "react";
import { Navbar, Container } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./Home";
import Cnt from "./Cnt";

function Uphead() {
  return (
    <Router>
      <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand>üåç Travel Explorer</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <div className="ms-auto d-flex gap-3">
              <Link to="/" className="nav-link text-light">Home</Link>
              <Link to="/contact" className="nav-link text-light">Contact</Link>
              <Link to="/about" className="nav-link text-light">About</Link>
              <Link to="/gallery" className="nav-link text-light">Gallery</Link>
            </div>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* ‚úÖ All Routes defined here */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contact" element={<Cnt />} />
        <Route path="/about" element={<h2 style={{ textAlign: "center", marginTop: "40px" }}>About Page Coming Soon</h2>} />
        <Route path="/gallery" element={<h2 style={{ textAlign: "center", marginTop: "40px" }}>Gallery Page Coming Soon</h2>} />
      </Routes>
    </Router>
  );
}

export default Uphead;
